import React from 'react'

const Note = ({id, text}) => {
  return (
    <div className='note'>
        <div className='note-body'>{text}</div>
        <div className='note_footer'>

        <button className='note_save'>Delete</button>
        <button className='note_save'>Edit</button>

        </div>
    </div>
  )
}

export default Note
